import { faGithub } from '@fortawesome/free-brands-svg-icons';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import React from 'react';
import { OverlayTrigger, Tooltip } from 'react-bootstrap';
import styled from 'styled-components';
import researchNet from './images/researchnet.png';


const Icons = styled(FontAwesomeIcon)`
  margin: 10px 15px 10px 15px;
  color: #c9b7a7;
`;

const CopyRightText = styled.p`
  color: #000000;
`;

const FooterLinks = styled.div`
  text-align: center;
  padding: 100px 0;
`
const FooterTitle = styled.p`
  color: #fff;
`
const Footer = () => {
  return (
    <div>
      <FooterTitle>This doesn't have to end yet â€” Let's Connect!</FooterTitle>
      <FooterLinks>
        <OverlayTrigger
          placement="bottom"
          delay={{ show: 250, hide: 400 }}
          overlay={<Tooltip id={`tooltip-top`}>Github</Tooltip>}
        >
          <a href="https://devpost.com/software/htg-researchnet/">
            <Icons icon={faGithub} size="lg" />
          </a>
        </OverlayTrigger>
      </FooterLinks>
    </div>
  )
}

export default Footer
